import "./ExpensesItem.css";
import ExpensesDate from "./ExpensesDate";

function ExpensesItem(props) {
  return (
    <div className="container flex">
      <ExpensesDate />
      <div className="items ">
        <h2>{props.title}</h2>
        <div className="price">${props.price}</div>
      </div>
    </div>
  );
}

export default ExpensesItem;
